    let res = f();
    let stop_reason = self.kill_state.end_hostcall();

    if let Some(termination_details) = stop_reason {
        // TODO: once we have unwinding, panic here instead so we unwind host frames
        unsafe {
            self.terminate(termination_details);
        }
    }

    res
