fn logs_bloom(logs: Vec<Log>, bloom: &mut Bloom) {
	for log in logs {
		bloom.accrue(BloomInput::Raw(&log.address[..]));
		for topic in log.topics {
			bloom.accrue(BloomInput::Raw(&topic[..]));
		}
	}
